import { FunctionComponent } from "react";
import styled from "styled-components";
import { theme } from "../../styles/theme/theme";
import { Title } from "../resuable-styled/text";
import LoginButton from "./button";
import LoginProfileImage from "./profile-image";

const Container = styled.button`
  width: 400px;
  height: 500px;
  z-index: 10;

  background-color: ${theme.colors.ui.main};

  border-radius: 15px;

  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;

  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
`;

const LoginTitle = styled(Title)`
  margin-bottom: ${theme.spacing.space.xxlarge};
`;

const LoginBox: FunctionComponent = () => {
  const onClickHandler = (e: React.MouseEvent) => {
    e.preventDefault();
    window.location.href = `http://127.0.0.1:3333/api/auth/twitter target="_blank" `;
  };

  return (
    <Container>
      <LoginTitle>Welcome to Tweety</LoginTitle>
      <LoginProfileImage />
      <LoginButton onClick={onClickHandler} />
    </Container>
  );
};

export default LoginBox;
